@SamsClub is truly insufferable sometimes, my god. 

*tries to buy item, but needs to use phone to pay for it to get the sale price

*tries to shop at 8:30am before doctor’s appt, needs to be “plus member” to shop before 10:00am

@SamsClub Why won't Sam's Club install the tires I want on my car?

